webpackJsonp([0xa6ad2b7c7d99],{389:function(e,t){e.exports={data:{markdownRemark:{html:'<h1 id="contributing-to-frintjs"><a href="#contributing-to-frintjs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Contributing to FrintJS</h1>\n<!-- MarkdownTOC autolink=true bracket=round -->\n<ul>\n<li><a href="#code-of-conduct">Code of Conduct</a></li>\n<li><a href="#open-development">Open Development</a></li>\n<li><a href="#bugs-and-issues">Bugs and Issues</a></li>\n<li><a href="#proposals">Proposals</a></li>\n<li><a href="#sending-a-pull-request">Sending a pull request</a></li>\n<li><a href="#get-in-touch">Get in Touch</a></li>\n<li><a href="#license">License</a></li>\n</ul>\n<!-- /MarkdownTOC -->\n<h2 id="code-of-conduct"><a href="#code-of-conduct" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Code of Conduct</h2>\n<p>We have adopted a Code of Conduct, that we expect all the participants of our project to adhere to. You can find the full text <a href="https://github.com/frintjs/frint/blob/master/CODE_OF_CONDUCT.md">here</a>.</p>\n<h2 id="open-development"><a href="#open-development" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Open Development</h2>\n<p>Development of the project is done publicly on <a href="https://github.com/frintjs">GitHub</a>. Core team members and also other external contributors send Pull Requests and they all go through the same review process.</p>\n<h2 id="bugs-and-issues"><a href="#bugs-and-issues" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Bugs and Issues</h2>\n<p>Bugs can be reported as <a href="https://github.com/frintjs/frint/issues">GitHub Issues</a>.</p>\n<p>Before submitting any issue, please make sure they are not a duplicate of any other <a href="https://github.com/frintjs/frint/issues">existing issues</a>.</p>\n<h2 id="proposals"><a href="#proposals" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Proposals</h2>\n<p>For every new feature, package or a change, we post <a href="https://github.com/frintjs/frint/issues?q=is%3Aissue+is%3Aopen+label%3Aproposal">proposals</a> under GitHub Issues publicly.</p>\n<p>Members from the project and other interested parties can then comment on the proposal, discussing about the strengths and weaknesses, and the proposal gets refined/updated based on feedback.</p>\n<p>Once the spec is ready and finalized, the development begins.</p>\n<p>In your Proposal description, make sure you answer these questions:</p>\n<ul>\n<li>What is the current situation?</li>\n<li>What is the proposed change?</li>\n</ul>\n<h2 id="sending-a-pull-request"><a href="#sending-a-pull-request" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Sending a pull request</h2>\n<p>If you are looking for ways to contribute with code or documentation to the project directly, you can help us out by contributing to issues with <a href="https://github.com/frintjs/frint/issues?q=is%3Aissue+is%3Aopen+label%3A%22help+wanted%22"><code>help wanted</code></a> label on GitHub.</p>\n<p>We already have automated checks for tests and linting for all Pull Requests, but you can always run these commands locally to make sure everything is working as expected:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>$ npm install\n\n$ npm run bootstrap\n$ npm run lint\n$ npm test</code></pre>\n      </div>\n<p>If your Pull Request results in a change in the API, then please update the <a href="https://github.com/frintjs/frint/tree/master/examples">examples</a> in the same repository accordingly, as well as the API documentation (<code>README.md</code> of every package).</p>\n<h2 id="get-in-touch"><a href="#get-in-touch" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Get in Touch</h2>\n<ul>\n<li><a href="https://twitter.com/frintjs">Twitter</a></li>\n<li><a href="https://github.com/frintjs/frint">GitHub</a></li>\n<li><a href="https://gitter.im/frintjs/frint">Gitter</a></li>\n<li><a href="https://medium.com/frintjs">Medium</a></li>\n</ul>\n<h2 id="license"><a href="#license" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>License</h2>\n<p>By contributing to FrintJS, you agree that your contributions will be licensed under its MIT license.</p>',frontmatter:{path:"/docs/contributing/guide",title:"Contribution guide",importFromGitHub:"frintjs/frint/master/CONTRIBUTING.md"}}},pathContext:{}}}});
